public static byte gfMul(byte a, byte b) {
  if ((a == 0) || (b == 0)) {
    return 0;
  }

  int tmp = (GF_LOG_BASE[a & 0xff] & 0xff) +
      (GF_LOG_BASE[b & 0xff] & 0xff);
  if (tmp > 254) {
    tmp -= 255;
  }

  return GF_BASE[tmp];
}
